svg.script:
		function initSVG(evt) {
		    // Get the svg doc object from the event info and set the root_svgDocument for use in later funcs.

			var svgDoc = evt.target.ownerDocument;

           this.parent._svgDocument = svgDoc;

           // timeout value in milliseconds
           setTimeout("this.parent.initData()",1000);
		}
